import React from 'react';
import AppsButton from './AppsButton.jsx';
import Image from './assets/LinkedIn.png';
import Image1 from './assets/GitHub.png';
import CSPPTLogo from './assets/csppt_logo.png'
import LancasterLogo from './assets/Lancaster.png';
import Notepad from './assets/Notepad.svg'
import DraggableComponentPhone from './DraggableComponentPhone.jsx';
function PhoneApps() {  
    return (
      <>
        <div className='Applications'>
        <DraggableComponentPhone className="DraggableOne" source={"https://www.linkedin.com/in/kyryloposty/"} order={0}>

        </DraggableComponentPhone>
        <DraggableComponentPhone className="DraggableOne" source={"https://github.com/Kyrylo234"} order={1}>

        </DraggableComponentPhone>
        <DraggableComponentPhone className="DraggableOne" source={"https://github.com/Kyrylo234/CSPPT"} order={2}>

        </DraggableComponentPhone>
        <DraggableComponentPhone className="DraggableOne" source={""} order={3}>
          <AppsButton title='About Me' source={Notepad}  alternative='GitHub logo' loading="lazy"/>
        </DraggableComponentPhone>
        <DraggableComponentPhone className="DraggableOne" source={""} order={4}>
          <AppsButton title='CV' source={LancasterLogo}  alternative='GitHub logo' loading="lazy"/>
        </DraggableComponentPhone>
        <AppsButton title='LinkedIn' source={Image} alternative='LinkedIn logo' loading="lazy"/>
        <AppsButton title='GitHub' source={Image1}  alternative='GitHub logo' loading="lazy"/>
      </div>
      </>
    )
  }

  export default PhoneApps
